import React from 'react';
import Navbar from './components/Navbar'; // Importer la barre de navigation
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import GroupStage from './pages/GroupStage'; // Ta page de groupe

function App() {
    return (
        <Router>
            <Navbar />
            <Switch>
                {/* Autres routes ici */}
                <Route path="/classement" component={GroupStage} />
                {/* Ajouter tes autres pages */}
            </Switch>
        </Router>
    );
}

export default App;
